(3, '2021-04-19 23:50:31', 'Sejarah TBAS', 'sejarah-tbas', '<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Pada\r\nabad ke – 9 kedatangan penduduk adalah dari \r\nLereng Gunung Merapi yaitu Pariangan Padang Panjang.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Tuo\r\nulayat Cancan Latieh yang mulo-mulo turun dari Pariangan Padang Panjang adalah\r\ndua orang tuo (oleh masyarakat dipanggil ‘Rang Kayo’) karena kaya dengan adat\r\ndan budaya. Yang seorang bergelar Dt. Perpatih Nan Sabatang dan yang satu lagi\r\nbergelar Dt. Perpatih Suanggi, kedua orang tersebut turun dari Pariangan Padang\r\nPanjang bersama dengan rombongan menuju ke Selatan dari Pariangan dan menempat\r\ndi Aur Seriau setelah tiba di tempat itu maka beliau bersama rombongan sepakat\r\nmembuat Cancan Latiah dan dibuat pemukiman \r\nyang waktu itu di beri nama Taratak Aur Seriau. Kemudian setelah semakin\r\nramai sepakat pula Taratak dijadikan sebagai Koto yaitu  Koto Kaciak. Salah seorang dari rang tuo\r\ntersebut yaitu  Dt. Perpatih Nan Sabatang\r\nyang juga membawa rombongan melanjutkan perjalanannya menyelusuri Sungai dari\r\nAur Seriau dan menempat di Guguk Longgung, disini juga dibuat Taratak dan Koto\r\nyang bernama Koto Baranjak, semasa itu Dt. Perpatih Nan Sabatang mendengar\r\nkabar bahwa ada sanak dan kemenakannya di daerah Aie Gamuruah (Ulu Paliki) ,\r\nmaka dibawalah ke Guguk Loggung tersebut dengan sebutan Orang Korong\r\nGodang,yang sebelumnya di guguk longgung sudah ada rajo mangarah.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Kemudian\r\nsetelah berkembang juga di Koto Kociek dan dari Koto Baranjak maka sepakat\r\npulalah mencari pemukiman yang lebih luas maka \r\nperkampungan ini dinamakan Koto Gadang.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Dalam\r\nperjalanan kedatangan Dt. Perpatih Nan Sabatang dan Dt. Perpatih Suanggi ini\r\njuga diikuti oleh tiga orang tuo. Yaitu Dt. Cumano yang menepat di Payo Batu,\r\nDt. Jalelo di Tanjung Medan, dan Dt. Rang Kayo Bungsu di Muaro Kumani.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Kemudian\r\ndari itu turun pula seorang tuo (Rang Kayo) dari Pariangan Padang Panjang yang\r\nbergelar Dt. Paduko, beliau turun dari Pariangan Padang Panjang melalui Atar\r\nTaluk. Menyeberang dan menempat di Bikang bahagian utara yang berdekatan dengan\r\nNgarai Putieh yaitu batas Nagari bahagian Utara saat ini. Dan beliau bertemu\r\ndengan 2 orang tuo yang dari Selatan di dekat sebatang kayu besar yang bernama\r\nKayu Pogang, ketika itu ketiga rang kayo telah bersejarah tentang asal usul\r\nbeliau masing-masing, yang sama-sama turun dari Pariangan Padang Panjang.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Dengan\r\nkedatangan satu orag rang kayo maka ada enam orang rang tuo. Kemudian ke-enam\r\nrang tuo tersebut berkumpul di rumah Dt. Perpatih Suanggi . maka dibagilah\r\nwilayah yang bagiannya tersebut yaitu Gunung dek Dt. Perpatih Suanggi, Bukik\r\ndek Dt. Perpatih Nan Sabatang ,  Padang\r\nNan Datar dek Dt. Paduko, Payo Nan Lowe dek Dt. Cinamo, Padang Nan Luas dek Dt.\r\nJalelo, Sagalo Muaro dek Dt. Rang Kayo Bungsu. Itulah nan dinamokan Hutan untuk\r\ncucu kamanakan, itulah yang dinamakan pembagian sodang duduak dan mufakat, dan\r\ndibuat nagari yang bernama Aur Kumani.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Kemudian\r\nsecara diam-diam pergilah ke subarang dua orang rang tuo yaitu Dt. Jalelo dan\r\nDt. Rang Kayo Bungsu dan tabao rombongannyo.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Maka\r\nhebohlah di Aur dan bermufakatlah Rang Tuo Nan Barampek siapa yang akan menjadi\r\nPanghulu Pucuk di Subarang (Kumanis). Maka terdapatlah kata sepakat yang menjadi\r\npucuk di Subarang (Kumani)  yaitu Dt.\r\nCinamo dan nama Nagari tetap Aur Kumani<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Setelah\r\nitu tiga orang di Aur berbincang-bincang, maka sepakat pula untuk membagi\r\nulayat dan dicari tempat yang layak sebagai tempat duduk (mufakat)  dalam pembagian ulayat. yang pada waktu itu\r\ndisepakati tempatnya di Air Timbu, dan dicari pula 3 buah batu untuk sandaran\r\ndan tempat itu diberi nama Batu Tigo.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Sebelum\r\ndilakukan pembagian sepakat pula ke 3 orang tuo tersebut terlebih dahulu untuk\r\nmeninjau lokasi yang ada di bahagian utara maka diselusuri dari kayu Pogang\r\nsampai ke ngarai Putieh,baringin sikuiek aur baririk ujung tanjung madok mudiek\r\nparik basiku dan batu bakakok yaitu perbatasan nagari Tanjung Bonai Aur saat\r\nini dengan nagari Tigo jangko,Taluk masing-masing kecamatan Lintau Buo Kab\r\nTanah Datar.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Setelah\r\nselesai peninjauan lokasi tersebut maka kembali lagi ke tempat batu tigo guna\r\nuntuk dilanjutkan pembahagian Ulayat dengan kesepakatan sebagai berikut;<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl2 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Ulayat bahagian selatan\r\ndari kayu pogang di kuasai oleh datuk perpatih suanggi<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl2 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Ulayat bahagian Timur\r\ndari Pogang dikuasai oleh Datuk Perpatih Sabatang<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl2 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Ulayat bahagian Utara\r\ndikuasai oleh Datuk Paduko<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Sedangkan\r\nUlayat bahagian Utara lebih luas dari ulayat bahagian selatan karena\r\ndiperkirakan waktu itu pertambahan penduduk lebih banyak datang dari bahagian\r\nutara.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Selanjutnya\r\nbeliau menetapkan batas-batas nagari sebagai berikut;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:42.55pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:-6.55pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">1.Sebelah Utara berbatas dengan\r\nNgarai Putieh,baringin sikuek sampai ke batu bakakok (Nagari Tigo jangko dan\r\nNagari Taluk kec.Lintau Buo).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:42.55pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:-6.55pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">2.Sebelah selatan berbatas dengan\r\nmejan bacium,labuh jawi (Nagari guguk dan Nagari Padang lawas Kec. Koto VII).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">3.Sebelah\r\ntimur berbatas dengan Batu Bajanjang Nagari Padang Lawas.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">4.Sebelah\r\nBarat berbatas dengan Batu Bakakok Kenagarian Taluk.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Kemudian\r\ndari itu turun pula 1 orang lagi orang Tuo (rangkayo) yang bagala Dt.Rajo\r\nMangawal yang turun dari Pariangan Padang Panjang melalui Batu Bulat –Taluk\r\nsampai ditepi sinamar dan selanjutnya beliau langsung menyeberang dengan\r\nsebatang Aur yang menjulai dari seberang keseberang ,setelah sampai beliau\r\nkesubarang, beliau melajutkan perjalanannya ke Utara dan basuo Kampung dengan\r\ndataran yang baik sehingga dinamai lokasi itu Kampung suo, setelah itu beliau\r\nmelanjutkan perjalanannya ke utara dan bertemu pula dataran dan rawa sehingga\r\nbeliau waktu itu pikirannya tatumbuk(tatobek) dan diberi nama lokasi itu sawah\r\ntobek karena tidak ada lagi dataran yang mngkin untuk di garap lagi.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Dengan\r\nadanya kedatangan Dt.Rajo Mangawal ini diketahui oleh Dt.Paduko yang waktu itu\r\ntelah bertempat Koto Tanjung Bonai, maka kedatangan rangtuo ini tidak bisa\r\ndiputuskan oleh Dt.Paduko dan dipanggillah Dunsanak yang berdua yang bertempat\r\ndi Koto Gadang. Dan dilakukanlah mufakat ditempat yang paliang elok (dipiliang)\r\ndengan mencari 4 buah batu untuk tempat duduk bersandar.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Setelah\r\ndiceritakan pembahagian rang Tuo yang bertiga tadi maka diminta lah oleh\r\nDt.Rajo Mangawal, Lubuak lah yang paling topek dek ambo.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Kemudian\r\nke empat orang Tuo tersebut telah sepakat pula untuk membuat Monografi nagari\r\ndan sekaligus disepakati untuk menyusun suku, maka kesepakatan beliau barampek\r\nsuku disepakati 4 suku yang dibagi atas 4 bahagian antara lain sbb;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">1.Suku\r\nMelayu yang dipegang oleh Datuk Perpatih Suanggi(panghulu pucuak)<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">2.Suku\r\nCaniago yang dipegang oleh Datuk Perpatih Sabatang (Panghulu pucuak).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">3.\r\nSuku Petopang yang dipegang oleh Datuk Paduko (panghulu pucuak).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">4.\r\nSuku Piliang yang dipegang oleh Datuk Rajo Mangawal (panghulu pucuak).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Dan\r\ndisepakati pula untuk pembagian Teratak, dari teratak menjadi Koto terbagi\r\nmenjadi Teratak 9 dan Koto 9 (Teratak Koto Sembilan,Sembilan dengan Sabiluru yang\r\nsekarang masuk nagari Tamparungo) dengan rincian sebagai berikut;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.5in;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Kok\r\nketek dinamokan Teratak dan kok Gadang dinamakan Koto yaitu sbb;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\nline-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Teratak\r\nterdiri dari ;<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl4 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Teratak Tigo Guguak<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl4 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Teratak Longgang<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl4 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Teratak Guguak Mangkudu<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl4 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Teratak Balai-balai<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl4 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">5.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Teratak Ulu Paliki<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl4 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">6.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Teratak Parit<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl4 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">7.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Teratak Riak<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl4 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">8.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Teratak Puntian<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl4 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">9.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Teratak Sabiluru\r\n(sekarang masuk nagari Tamparungo)</span></p><p class=\"MsoListParagraph\" style=\"margin-left:.75in;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl4 level1 lfo2\"><span style=\"font-family: \"Times New Roman\", serif; font-size: 1rem; text-indent: 35.45pt;\">Dan Koto Terdiri dari;</span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Koto Kociek<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Koto Baranjak<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Koto Gadang<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Koto Pupuan <o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">5.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Koto Puntian<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">6.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Koto Tongah<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">7.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Koto Tanjung Bonai<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">8.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Koto Tinggi<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">9.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Koto Baru<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:35.45pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Adapun Koto Tanjung Bonai sebelumnya banyak ditumbuhi\r\noleh kayu yang bernama kayu Bonai maka koto ini bernama Koto Tanjung Bonai.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Pada abad ke 13 ada seorang Syehk yang bernama syehk\r\nIbrahim beliau berasal dari kudus di daerah jawa, beliau mencari suatu tempat\r\nyang ditemukan melalui sebuah mimpi, mimpi beliau adalah “ disuatu tempat ada\r\nsuatu benda ajaib yang kalau dipakai dan dipelihara akan banyak manfaatnya”\r\nsetelah lama beliau berkelana beliau bermimpi lagi bahwa beliau belum sampai\r\npada tempt yang di tuju, mimpi beliau tempatnya ada kayu besar Sitopuang\r\nBungkuak. Akhirnya beliau sampai disuatu tempat yang bernama Aur Siriau\r\nsesampainya dilokasi kayu Sitopuang Bungkuak beliau menemukan ada binatang\r\nbesar yang keluar masuk lubang. Karena itulah tempat yang dituju dalam mimpinya\r\ndulu sambil berkata “ Iko Bau” artinya barulah ketemu tempat yang dicari itu\r\ndan binatang itu dinamakan Kobau, semakin banyaknya keluar masuk binatang itu\r\nmaka ditutuplah lubang itu dengan memancung sebatang aur dan ditancapkan disitu\r\nmaka aur itu benama aur Duoto, sampai saat ini tempat tersebut dijadikan tempat\r\nberkaul ternak dan pintu kandang ternak harus menhadap ke aur Duoto tersebut.\r\nDisini beliau menetap diKoto Gadang menginap waktu itu dirumah Datuk Perpatih\r\nsabatang selama beliau meninjau keadaan penduduk  yang waktu itu masyarakatnya makan Ular\r\naluang,kelelawar,berjudi,penyabung yang tempatnya dibawah kayu pogang.  <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Setelah diketahui tentang perbuatan dari penduduk yang\r\nberada disekitar itu,maka timbullah minat Syehk Ibrahim untuk menyampaikan\r\najaran Islam dengan cara tipu muslihat, sehingga penduduk diajarkan membaca dua\r\nkulimah syahadat dan sewaktu penduduk akan pergi mandi ketempat sumber air yang\r\nada di sekitar mesjid Pincuran 7 saat ini, cara beliau menyampaikan ajaran\r\nkepada penduduk ,sambil  duduk diatas\r\nsebuah batu ditepi jalan kesumber air.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Berkat cara penyampaian dengan cara tersebut, maka\r\nmasyarakat mau menerima ajaran itu dan kemudian dibangunlah Mesjid bersama-sama\r\ndan membendung sumber air tersebut dan dibuat Pincuran sebanyak 7 buah yang\r\nmelambangkan kebesaran dan kesucian dari rang Tuo yang batujuah (Inyiek nan\r\nbatujuah).dua buah Pincuran hulunya ada yang di dekatkan.dan di bahagian atas\r\ndipinggir jalan kemesjid,dekat itulah rumah Syehk Ibrahim yang dikenal dengan\r\nnama Inyiek Tanah Bato dan juga sering sebutannya Inyiek Parumahan ,waktu itu\r\nNagari Aur Kumani tetap satu. Dari sinilah berulangnya Inyiek Tanah Bato ke\r\nSumpur Kudus dengan membawa satu ekor kerbau pembajak sawah.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Pada sekitar Abad 14 datanglah seorang raja bersama\r\nrombongan yang menyusuri batang sinamar, sesampainya dibiaro kapalnya\r\ntersangkut batu ajaib,setelah didaratan raja menimbang batu ajaib tersebut\r\ndengan sebuah permata yang bernama”janggi” dan raja memutuskan disinilah tempat\r\nbermukim yang baik yang bertempat di Tanjung Medan. Raja tersebut bernama\r\nSultan Maharajo Dirajo atau lebih dikenal dengan rajo Alam. Didalam perjalanan\r\nRajo Alam mendapat sebuah telur yang setelah menetas ternyata itu telur buaya.anak\r\nbuaya tersebut dipelihara oleh anak rajo Alam yang diberi nama “Tumanggung”,\r\nrupanya setelah buaya besar membawa petaka dimana anak rajo Alam dimakan buaya.\r\nSetelah dkumpulkan hulubalang tidak ada yang berani membunuh buaya tersebut,\r\nmaka dipanggillah oleh rajo alam rang Tuo(Inyiek) yang batujuah. Salah seorang\r\nmengusul yang sanggup untuk membunuh buaya itu ada seorang sakti yang tinggal\r\ndidaerah Agang yang di sebut Gunung nan Tongga(kayok) dan namun untuk\r\nmenjeputnya tidak seorangpun yang berani dan yang menyangupi untuk menjeputnya\r\nadalah Intan Batuah. Menurut istrinya untuk membangunkan pandeka kayok  dengan besi panas yang ditempelkan\r\ndibadannya. Sesampainya di istana pandeka kayok menyanggupinya, setelah buaya mati\r\npandeka kayok diberi hadiah emas oleh rajo alam namun ditolak dengan\r\nhalus,mendengar penolakan pandeka kayok tentang hadiah yang diberikan rajo alam\r\nberpikir dan di angkatlah sebagai Dubalang Rajo alam dan diberi wilayah yang\r\ntak lakang dek paneh dak lapuak dek hujan. Untuk keamanan kerajaan, rajo Alam\r\nmemagar tempat pemandian itu dengan ruyung yang didatangkan dari ibul (bukit\r\nbual). Setelah pemandian dipagar dengan ruyung maka kerajaan ini terkenal\r\ndengan Pagaruyung <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Dalam pada itu timbullah kekacauan di Rantau Kuantan\r\ndalam hal ini terlebih dahulu telah ditanya ilmu apa yang dimiliki oleh\r\nDubalang Kayok  maka dijawab ilmu yang\r\nsaya pakai adalah sahabat nan anam belas. Maka untuk mengatasi kerusuhan di\r\nrantau kuantan yang ingin direbut oleh raja singiang-ngiang(raja jambi)\r\nrajo  Alam(rajo Pagaruyung) bersama\r\nInyiek nan batujuah mengutus Dubalang kayok dengan 16 orang pilihan dari nagari\r\nAur Kumani. Sepulangnya dari rantau Kuantan setelah berhasil menaklukan rajo\r\nsingiang-ngiang, dibantailah Kerbau yang tanduknya sebelah keatas dan sebelah kebawah\r\nmaka sepakat Inyiek dengan rajo Alam semasa itu, dikarenakan rantau lah salasai\r\nnagari lah aman  maka dilakukan sumpah\r\nsotieh “digantuang  tinggi dikalian dalam”\r\nmaka ditumpahkanlah adat ka datuak nan 16 yang bertempat dikubang tigo\r\nbaririk  serta disusun tatanan adat dan\r\npusoko serta dengan dibuatnya balai-balai Datuk nan anam belas. Dan Dubalang\r\nkayok diberi jabatan sebagai Rajo untuk rantau kuantan yang kurang oso(satu)dua\r\npuluh,dua puluh dengan muaro sijunjung dan menjadi Datuk dinagari Aur maka gelarnya\r\nmenjadi Datuak Rajo Dubalang maka diangkat menjadi adiek Bungsu Niniek kakak\r\ntuo datuak nan 16.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Sebagai rajo kuantan Datuak Rajo Dubalang tidak\r\nmembangun istana didaerah kekuasaannya, tetapi datang kesana sewaktu diperlukan\r\nsaja dan ditetapkan yang mewakilinya untuk melaksanakan dan menjalankan roda\r\npemerintahan .<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Seiring dengan perjalanan waktu para pembesar Istana\r\npagaruyung berpendapat dengan kejadian yang dialami raja dengan kematian anak\r\nnya maka kerajaan harus dipindahkan kelokasi lain yang lebih baik, karena itu\r\nraja bersama pengikut mencari tempat maka ditemukanlah didaerah dikaki bukit\r\nbatu patah atau pagaruyung sekarang.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Seiring dengan perpindahan rajo alam maka Inyiek nan\r\nbatigo dikumani juga membuat balai-balai adat dan dikoto Tanjung Bonai juga\r\nmendirikan balai-balai adat datuak nan balimo. Dengan sendirinya Nagari bernama\r\nnagari Aur dan nagari Kumani.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\"> </span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Nagari\r\nAur menganut system adat;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Pisang\r\nkolek-kolek hutan<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Pisang\r\nTimbatu yang bagota<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Samo\r\nbabungo kaduonyo<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Bodi\r\ncaniago bukan <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Koto\r\nPiliang bukan<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Samo\r\nbaguno kaduonyo.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">         Susunan adat dan pusoko merupakan\r\nsebuah perahu yaitu pakai haluan dan kumidi.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Haluan\r\nadalah Dt.Perpatih Suanggi (urusan Syarak)<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Kamudi\r\nadalah Dt.Perpatih Sabatang (urusan Adat)<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\"> </span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Dan nagari ini berbentuk nagari kesatuan yaitu\r\nbaniniek nan barampek balimo dengan Datuak Rajo Dubalang dengan susunan pusoko\r\nsebagai berikut;<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl0 level1 lfo4\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Pusoko nan sapuluah di\r\nate (pusoko Tinggi)<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Yang terdiri dari: Niniek barampek\r\nbalimo jo Datuak Rajo Dubalang<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:.25in;mso-char-indent-count:1.5;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">  Malin barampek balimo jo Pokieh Kadli<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl0 level1 lfo4\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Badatuak nan anam belas\r\ndan badatuak nan balimo<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl0 level1 lfo4\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Badatuak Panghulu Andiko<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:42.55pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Balai-balai adatnya merupakan balai-balai yang\r\nterpakai di Bodi caniago yaitu berlabuah kudo di tongah-tongahsebagai pamocah\r\nruang. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:39.0pt;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Kebesaran\r\ndari masing-masing pusoko sebagai berikut;<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl3 level1 lfo5\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Pusoko nan sapuluah di\r\nate; Untuak ka pai tampek batanyo kembali tempat babarito oleh datuak nan 16\r\n(melalui Monti Gadang)<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl3 level1 lfo5\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Datuak nan16 ; yang\r\ndiberi tugas oleh Pusoko nan 10 di ate untuk menjalankan Adat dan Pusoko yang\r\nberlaku di nagari aur , Adat salingka nagari(biang cabiek gantiang putuih)\r\ndalam penyelesaian perkara Adat dan Datuak 16 dikepalai oleh 4 orang Datuak\r\nSondi Adat, didalam tugas ujung jari sambung lidah dari nan 10 di ate adalah\r\nMonti Gadang.<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl3 level1 lfo5\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Datuak nan 5 (balimo);\r\nDatuak nan balimo berada di Koto Tanjung Bonai yang bertugas apabila terjadi\r\nmasalah di Koto Tanjung Bonai dalam penyelesaiannya oleh Datuak nan 5 (balimo),\r\nkiranya belum dapat penyelesaiannya dinaikan ke Datuak nan 16 disitu biang\r\ncabiek gantiang putuih oleh datuak nan 16.<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-left:57.0pt;text-align:justify;\r\ntext-justify:inter-ideograph;text-indent:-.25in;line-height:normal;mso-list:\r\nl3 level1 lfo5\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif;\r\nmso-fareast-font-family:\"Times New Roman\"\">4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">     </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Datuak Panghulu Andiko ;\r\ndiberi kekuasaan memimpin adat dengan syarak dikampuang masing-masing beserta\r\ndengan ke empat jinni nya.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">  Tahun 1837\r\nrakyat nagari Aur pernah membantu  rakyat\r\nlintau Buo dan 50 kota dengan beras dan makanan melalui sebuah bukit antara\r\nnagari Buo dengan Lubuk jantan, bukit yang bernama bukik guliang beras karena\r\ndari sana beras digulingkan untuk makanan angkatan perang Paderi dan rakyat\r\nLintau Buo.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Kemudian pada tahun 1918 nagari ini dirobah namanya\r\nmenjadi Nagari Tanjung Bonai Aur dan semasa itu nagari ini berlareh ke Buo.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Tahun 1918 selesai perang dunia pertama daerah Tk II\r\nTanah Datar dan Swl/Sijunjung kekurangan makanan,maka oleh Contraktiur\r\nSijunjung dipaksakan pada rakyat Tanjung Bonai Aur untuk menjual padi untuk\r\nmakanan rakyat tersebut di atas.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Pada waktu Clasehe ke II tahun 1948-1949 selama 3\r\nbulan di nagari Tanjung Bonai Aur ditempatkan Pemerintah PDRI staf Gubernur\r\nmiliter sumatera tengah dan staf Bupati Militer swl/Sijunjung yaitu dari bulan\r\njanuari s/d april 1949 dan tanggal 30 juni 1949 Nagari Tanjung Bonai Aur di\r\nbumi hanguskan oleh kerajaan Belanda, <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">puluhan rumah Adat dan rumah lainnya dibakar dan\r\npuluhan ternak ditembaki oleh tentara Belanda.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Pada tanggal 18 Februari 1949 di mesjid Pincuran Tujuh\r\nKoto Gadang dilaksanakan pembentukan Kabupaten Sawahlunto Sijunjung , pada\r\nwaktu itu oleh Gubernur Sumatera Tengah Tengku Muhammad Hasan menunjuk Sulaiman\r\nTantuah Bagindo Ratu sebagai kurir sekaligus sebagai Bupati Sawahlunto\r\nSijunjung karena jabatan Bupati militer sedang kosong (Bupati sebelumnya\r\nJamaris Yahya di tangkap Belanda). Pada waktu itu Sulaiman Tantuah Bagindo Ratu\r\nselaku kurir mengantarkan surat kepada Mr Syafrudin Prawira Negara ke pusat\r\npemerintahan di Suliki Waktu itu bermalam dirumah guru Syukur di Koto Gadang.\r\nDalam rangka kab Tanah Datar dibagi dua yaitu Kab Swl/Sijujung dan Kab Tanah\r\nDatar.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Kemudian 3 bulan menjabat Bupati Sulaiman Tantuah\r\nBagindo Ratu ditarik ke pusat pemerintahan PDRI (koto tinggi paya kumbuh).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:42.55pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Kemudian dalam pelaksanaan muyawarah Pemerintahan\r\nKabupaten yang dilaksanakan di Mesjid Pincuran Tujuah Koto Gadang pada tanggal\r\n18 februari 1949 dan selanjutnya Gubernur sewaktu itu telah mengangkat seorang\r\ntokoh masyarakat asal putra daerah yaitu Jarjis Bebas Tani sebagai Bupati\r\nSwl/Sijunjung.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:39.0pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\r\n\"Times New Roman\",serif\">Pada bulan Maret 1949 rapat dilanjutkan diSurau\r\nPiuncuran Rodah dan sebelumnya di Surau Maco masing-masing surau tsb milik Dt\r\nMonggung dan Engku Oyok. Kemudian dilanjutkan dengan pembentukan kewedanaan 3\r\ndan kecamatan 5 buah, kecamatan Sumpur Kudus dengan camatnya Rifa’i kantor di\r\nTanjung Bonai Aur. Waktu itu dihadiri oleh para Menteri dalam rangka PDRI; Mr\r\nSyafrudin Prawira Negara (Presiden PDRI),Tengku Muhammad Hasan (Gubernur\r\nSumatera Tengah), Ir Sitompul Menteri (Pekerjaan umum),Ir Indra Jaya(Menteri\r\nPerhubungan).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:6.0pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:39.1pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Tahun 1952 kantor Camat Sumpur\r\nKudus di pindahkan ke Kumanis sampai sekarang. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:6.0pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:39.1pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Pada tahun 1965 dilakukan renovasi\r\nterhadap mesjid pincuran tujuh dari memakai tonggak kayu menjadi permanen.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:6.0pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:39.1pt;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:\"Times New Roman\",serif\">Tahun 1983 oleh pemerintah\r\nKabupaten Swl/Sijunjung dengan Bupati nya Kol.Noer Bahri Pamuncak di bangun\r\nTugu Monumen Hari jadi Kabupaten Swl/Sijunjung yang bertempat di koto Gadang\r\nKenagarian Tanjung Bonai Aur yang Lokasinya tidak jauh dari mesjid Pincuran\r\nTujuh.<o:p></o:p></span></p>', 'foto_sejarah.jpg', 1, 6, 'publish');
