(23, '2021-05-25 13:24:57', 'PKK', 'pkk', '<div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: \"Open Sans\", Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); clear: both; text-align: justify;\"><span style=\"font-family: \"Times New Roman\";\">        Gerakan PKK merupakan Gerakan Nasional dalam pembangunan masyarakat yang tumbuh dari bawah, yang pengelolaannya dari, oleh dan untuk masyarakat. Pemberdayaan Keluarga meliputi segala upaya Bimbingan, Pembinaan dan Pemberdayaan agar keluarga dapat hidup sejahtera, maju dan mandiri. Tim Penggerak PKK adalah Mitra Kerja Pemerintah dan Organisasi Kemasyarakatan, yang berfungsi sebagai fasilitator, perencana, pelaksana, pengendali dan penggerak pada masing – masing jenjang demi terlaksananya program PKK.Tim Penggerak PKK adalah warga masyarakat, baik laki – laki maupun perempuan, perorangan, bersifat sukarela, tidak mewakili organisasi, golongan, parpol., lembaga, atau instansi, dan berfungsi sebagai perencana, pelaksana, dan pengendali gerakan PKK.</span></div><div style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: \"Open Sans\", Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); clear: both; text-align: justify;\"><br></div><div><table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"0\" style=\"width: 426pt; margin-left: 4.65pt;\">\r\n <tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;height:15.0pt\">\r\n  <td width=\"42\" nowrap=\"\" style=\"width:31.55pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0in 5.4pt 0in 5.4pt;height:15.0pt\">\r\n  <p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0in;margin-bottom