(27, '2021-06-18 23:17:53', 'Bukik Tanggaluang', 'bukik-tanggaluang', '<p class=\"MsoNormal\" style=\"text-indent:36.0pt\">Tanjung Bonai Aur Selatan\r\nmerupakan salah satu nagari yang terletak di Kecamatan Sumpur Kudus,&nbsp; Kabupaten Sijunjung, Provinsi Sumatera Barat.\r\nNagari ini dikelilingi oleh perbukitan. Selain itu, kondisi alam di Tanjung\r\nBonai Aur Selatan masih terbilang sangat asri dan indah dengan hamparan sawah\r\nyang masih sangat luas. Untuk melihat keindahan tersebut, terdapat salah satu\r\nbukit yang menjadi rekomendasi wisata yang cocok untuk dikunjungi, orang-orang\r\nmenyebutnya “Bukik Tanggaluang”.<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-indent:36.0pt\">Bukit Tanggaluang merupakan salah\r\nsatu bukit yang terletak di Nagari Tanjung Bonai Aur Selatan. Pemandangannya\r\nyang indah merupakan salah satu daya tarik tersendiri bagi pengunjung untuk\r\nmengunjunginya. Bukit ini diapit oleh beberapa bukit yang ada disekitarnya.\r\nUntuk mencapai puncak yang indah ini, maka dibutuhkan waktu 2 jam perjalanan\r\ndar kaki bukit. <o:p></o:p></p><p class=\"MsoNormal\" style=\"text-indent:36.0pt\">Jalur pendakian menuju puncak\r\nBukik Tanggaluang terbilang cukup mudah, sehingga sangat cocok untuk\r\norang-orang yang belum pernah melakukan pendakian sama sekali (pendaki pemula).\r\nSelama perjalanan, pengunjung akan menyusuri perkebunan karet warga setempat\r\ndan bahkan tidak menutup kemungkinan untuk pengunjung bertemu dengan warga yang\r\nsedang menyadap karetnya. Di beberapa tempat sebelum sampai kepuncak, kita akan\r\ndisajikan dengan pemandangan hamparan sawah yang sangat luas dan padatnya\r\nperumahan penduduk. Setelah sampai puncak, mata kita akan tertuju pada\r\npemandangan alam yang luas dan masih asri. Bukit-bukit yang menjulang tinggi\r\ndisetiap penjuru dapat dijadikan sebagai bacground untuk kita berfoto.<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-indent:36.0pt\">Wisata Bukik Tanggaluong ini\r\nsangat cocok dikunjungi secara beramai-ramai. Semakin banyak anggota pendakian\r\nmaka semakin seru perjalanan.</p>', 'tanggaluang.jpg', 1, 14, 'publish'),
(28, '2021-06-18 23:23:09', 'Ngalau Katinuok', 'ngalau-katinuok', '<p class=\"MsoNormal\"><span style=\"font-family: &quot;Times New Roman&quot;;\">Ngalau Katinuok merupakan salah destinasi wisata yang\r\nterletak di nagari Tanjung Bonai Aur Selatan. Wisata ini terletak didalam\r\nhutan&nbsp; yang masih sangat alami. Sealain\r\nitu wisata Ngalau Katinuok terletak diantara perbukitan yang menjadi penghias\r\nbentang alamnya. Objek wisata ini adalah bentuk ukiran alam yang diwariskan dan\r\ndiberikan kepada manusia untuk dinikmati keindahannya.</span></p><p class=\"MsoNormal\"><span style=\"text-indent: 36pt; font-size: 1rem; font-family: &quot;Times New Roman&quot;;\">Wisata Ngalau Katinuok terletak\r\nsekitar 3 kilometer dari pusat nagari Tanjung Bonai Aur Selatan. Waktu yang\r\ndiperlukan untuk sampai ke mulut Ngalau (Gua) ini ditempuh sekitar 1 jam 30\r\nmenit. Di dalam Gua ini, pengunjung akan disajikan sebuah keindahan yang\r\nmemanjakan mata. Stalagtit dan stalagnit yang menghiasi dinding gua meruapakan\r\ntetesan air yang membeku yang kemudian membentuk batuan indah di dalamnya.</span></p><p class=\"MsoNormal\"><span style=\"text-indent: 36pt; font-size: 1rem; font-family: &quot;Times New Roman&quot;;\">Gua ini dihuni oleh kawanan\r\nkelelawar yang membuatnya selalu riuh sepanjang waktu. Selain kelelawar,\r\nterdapat juga burung walet yang bersarang dicelah-celah langit-langit goa yang\r\nmenjulang sekitar 10m dari permukaan lantai goa.</span></p><p class=\"MsoNormal\"><span style=\"text-indent: 36pt; font-size: 1rem; font-family: &quot;Times New Roman&quot;;\">Didalam gua yang cukup gelap ini,\r\nterdapat beberapa tempat yang memiliki bentuk yang khas diataranya berbentuk\r\nseperti tumpukan salju, lampu gantung, dan seperti bak air yang\r\nbertingkat-tingkat.</span></p><p class=\"MsoNormal\"><span style=\"text-indent: 36pt; font-size: 1rem; font-family: &quot;Times New Roman&quot;;\">Wisata Ngalau Katinuok ini\r\nmenjadi salah satu tempat wisata yang harus dikunjungi apabila datang ke Nagari\r\nTanjung Bonai Aur Selatan. Terutama bagi orang-orang yang memang memiliki hobi\r\nmenyusuri hutan dan mencari tempat-tempat indah didalamnya.</span></p><p class=\"MsoNormal\" style=\"text-indent:36.0pt\"><o:p></o:p></p>', 'foto_ngalau_katinuok_2.jpg', 1, 14, 'publish'),
(31, '2021-06-30 12:02:41', 'Adobe', 'adobe', '<p>adobe adalah</p>', 'Picture1.jpg', 1, 1, 'publish'),
