(34, '2021-07-06 10:15:25', 'uruf Besar dan Miring + makna kata asing', 'uruf-besar-dan-miring-makna-kata-asing', '<p><span style=\"font-size: 1rem;\">1.&nbsp; &nbsp; &nbsp; Database adalah penulisan yang seharusnya dicetak miring menjadi Database(Bab II)</span><br></p><p>2.&nbsp; &nbsp; &nbsp; Penulisan Disis lain seharusnya ditulis menjadi disisi lain(Bab II)</p><p>3.&nbsp; &nbsp; &nbsp; Penulisan symbol seharusnya ditulis simbol(Bab II)</p><p>4.&nbsp; &nbsp; &nbsp; Penulisan Website seharusnya ditulis miring menjadi Website</p><p>5.&nbsp; &nbsp; &nbsp; Penulisan User seharusnya ditulis miring karena ini adalah kata asing jadi menjadi User(BAB III)</p><p>6.&nbsp; &nbsp; &nbsp; user id page 4 seharusnya ditulis miring karena ini adalah kata asing jadi menjadi user id(BAB III)</p><p>7.&nbsp; &nbsp; &nbsp; penulisan tahapan pada bab IV seharusnya penulisannya huruf besar Pnya karena itu adalah awal kalimat</p><p>8.&nbsp; &nbsp; &nbsp; system implementasi pada bab IV seharusnya ditulis miring dan ditulis huruf besar pada kata s dan I di sistem implementasinya menjadi Sistem Implementasi</p><p>9.&nbsp; &nbsp; &nbsp; penulisan hardware seharusnya di cetak miring pada bab IV karena itu adalah kata kata asing jadi penulisannya seharusnya hardware</p><p>10.&nbsp; &nbsp; &nbsp;Penulisan software seharusnya di cetak miring pada bab IV karena itu adalah kata asing jadi penulisannya seharusnya software</p>', 'Picture12.jpg', 3, 1, 'publish');

