INSERT INTO `halaman` (`halaman_id`, `halaman_judul`, `halaman_slug`, `halaman_konten`) VALUES
(8, 'Visi dan Misi', 'visi-dan-misi', '<p class=\"MsoNormal\" style=\"margin:0cm;margin-bottom:.0001pt;text-indent:0cm;\r\nline-height:115%;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><b><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">A. </span></b><!--[endif]--><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">&nbsp;&nbsp;</span></b><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Visi<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;text-indent:22.5pt;line-height:115%\"><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Visi Nagari tanjung Bonai\r\nAur selatan adalah <b><i>“terwujudnya Nagari Tanjung Bonai Aur Selatan yang Agamais, beradat,\r\nlestari, mandiri dan sejahtera dalam ridho Allah”</i>.</b><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:40.5pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l1 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">a)<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Nagari\r\nyang Agamais<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:40.5pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;line-height:115%\"><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">Adalah nagari yang menjunjung tinggi\r\nnilai Agama dalam kehidupan masyarakat.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:40.5pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l1 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">b)<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Nagari\r\nyang beradat<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:40.5pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;line-height:115%\"><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">Adalah nagari yang mengerti dan paham\r\nmengenal Adat Istiadat serta budiluhur, yang berlandaskan sebagaimana falsafah\r\nMinang Kabau <i>“ Adat basandi syarak,\r\nsyarak basandi kitabullah”</i>.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:40.5pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l1 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">c)<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Nagari\r\nyang lestari</span><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\"> </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:40.5pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;line-height:115%\"><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">Adalah Nagari yang mengutamakan\r\nkondisi lingkungan yang asri serta memiliki daya dukung untuk kehidupan\r\nmasyarakat hari ini dan masa yang akan datang.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:40.5pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l1 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">d)<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Nagari\r\nyang mandiri<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:40.5pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;line-height:115%\"><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">Adalah Nagari yang mempunyai semangat\r\ndan karakter yang tanguh dalam menggali dan memaksimalkan seluruh potensi yang\r\nada baik potensi sumberdaya manusia maupun sumberdaya alam, sehingga mampu\r\nmengatasi permasalahan dengan arif dan bijaksana.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:40.5pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l1 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">e)<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Nagari\r\nyang sejahtera dalam Ridho Allah<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:40.5pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;line-height:115%\"><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">Adalah nagari yang mengutamakan kedamaian\r\nkebersamaan, meminimalkan potensi konflik yang terjadi dalam nagari,\r\nmengoptimalkan seluruh sumberdaya manusia dan sumberdaya alam, sesuai dengan\r\npitatah urang tuo kito <i>“Dek barek samo\r\ndipikua, dek ringan samo dijinjiang, nan elok baimbauan, nan buruak bahambuan,\r\nelok dek awak katuju dek urang, nan bungkuak ka tangkai bajak, nan luruih\r\nkatangkai sapu”</i> sehingga tercipta keadaan aman, makmur dan damai.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;text-indent:22.5pt;line-height:115%\"><span lang=\"EN-US\" style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:\r\nEN-US\">Dalam menterjemahkan kebijakan umum pembangunan berdasarkan </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Visi\r\n</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">tersebut, dapat dilihat dari\r\nketerkaitan dengan masing-masing misi adalah sebagai berikut :</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;\r\ntext-indent:0cm;line-height:115%;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><b><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">B. </span></b><!--[endif]--><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">&nbsp;</span></b><b><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">Misi<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:78.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-78.0pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">Misi</span></b><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">\r