:EN-US\">keamanan.&nbsp;&nbsp; <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.5pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">2.Perspektif proses; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">peningkatan kinerja sektor pertanian, perdagangan,\r\nperkoperasian, perin-dustrian, </span><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">BUMNag</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> dan parawisata didorong melalui pengembangan\r\nkelembagaan kelompok tani secara optimal</span><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif\">, pokdarwis</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">, penguatan permodalan dan manajemen </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">bagi\r\nUMKM dan Koperasi</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">,\r\npengembangan produktivitas i</span><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">ndustri </span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">i</span><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">ndustri </span><span lang=\"EN-US\" 