ptimalisasi kinerja dan peningkatan kualitas pelayanan\r\n</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">nagari</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> di sektor pertanian, perdagangan, perkoperasian dan\r\nperindustrian serta parawisata dan peningkatan kualitas pelayanan </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">BPN</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">.&nbsp;&nbsp; </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.5pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">4.Perspektif pengelolaan keuangan; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">peningkatan kualitas penerapan anggaran berbasis\r\nkinerja dalam penyusunan rencana kerja, peningkatan efektivitas dan efisiensi\r\nbelanja pembangunan </span><span style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,serif\">nagari</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> dan peningkatan pengelolaan sumber-sumber pendapatan</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">\r\n</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">secara trasparan dan\r\nakuntabel.&nbsp;&nbsp;&nbsp; </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.5pt;\r\nline-height:115%\"><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Times New Roman&quot;,serif\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:49.65pt;margin-bottom:.0001pt;text-align:justify;text-indent:-49.65pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">Misi 3</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">\r\n</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">:</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">\r\n</span></b><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Mewujudkan\r\npeningkatan pembangunan insfrastruktur Sarana dan prasarana fasilitas umum\r\nnagari.</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:13.5pt;margin-bottom:.0001pt;text-align:justify;line-height:115%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">Ke