font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">. Selain itu, peningkatan</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\"> </span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">kuantitas dan kualitas</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\"> </span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">pengelolaan </span><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif\">jaringan irigasi</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> serta pengeloaan air bersih, sanitasi dan jalan\r\nlingkungan nagari serta drainase dan penataan pembangunan perumahan dan </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">pemukiman\r\nyang sehat</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\"> serta peningkatan\r\njaringan listrik dan telekomunikasi yang merata serta </span><span lang=\"SV\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:SV\">penataan ruang kawasan </span><span style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Permukiman Tanjung\r\nBonai Aur Selatan,</span><span lang=\"SV\" style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:SV\">terutama sistim\r\njaringan prasarana dan sarana fasilitas </span><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif\">nagari</span><span lang=\"SV\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:SV\">.</span><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.5pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">2.Perspektif proses; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">penegakan hukum tata ruang sesuai perundang-undangan\r\nyang berlaku be-kerjasama dengan aparat penegak hukum dan peningkatan tertib\r\nadminitrasi pertanahan bekerjasama dengan Badan Pertanahan Negara. Selain itu,\r\nperbaikan manajemen transportasi serta peningkatan ketertiban lalulintas\r\nberkerjasama dengan aparat kepolisian.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.5pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">3.Perspektif kelembagaan; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">peningkatan pengendalian pemanfaatan ruang dan\r\npeningkatan kualitas pelayanan terhadap penanganan jaringan transportasi serta\r\npeningkatan pegelolaan data base kebutuhan prasarana dasar masyarakat\r\nnagari/desa berbasis teknologi.&nbsp; <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.5pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">4.Perspektif pengelolaan keuangan; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">peningkatan pengelolaan </span><span style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Bumnag</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> secara trasparan dan akuntabel, sehingga dapat\r\nmeningkatkan PA</span><span style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,serif\">N</span><span lang=\"EN-US\" style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:\r\nEN-US\"> dan&nbsp; peningkatan efektivitas dan\r\nefisiensi belanja pembangunan </span><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">nagari</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> terhadap peningkatan kuantitas i</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">nfrastruktur\r\nserta prasarana dasar nagari</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">.</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:1.0cm;margin-bottom:.0001pt;text-align:justify;text-indent:-14.65pt;\r\nline-height:115%\"><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Times New Roman&quot;,serif\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:2.0cm;margin-bottom:.0001pt;text-align:justify;text-indent:-2.0cm;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">Misi </span></b><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">4</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">&nbsp; :&nbsp; </span></b><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Peningkatan\r\nkualitas sumberdaya manusia serta pemahaman dan pengamalan norma-norma agama\r\ndan adat istiadat.</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:13.5pt;margin-bottom:.0001pt;text-align:justify;line-height:115%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">Kebijakan umum yang tempuh dalam mewujudkan misi </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">4</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> adalah :<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.4pt;margin-bottom:.0001pt;text-align:justify;text-indent:-14.85pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">1. Perspektif masyarakat; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">peningkatan </span><span lang=\"EN-US\" style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Arial Unicode MS&quot;;mso-ansi-language:EN-US\">kualitas </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">pelayanan\r\nkehidupan beragama</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\"> yang\r\nberlandaskan adat basandi syara’, syara’ basandi kitabullah. serta peningkatan\r\neven penyelenggaraan seni budaya anak nagari yang berkesinambungan dan </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">berkualitas</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">, agar seni budaya yang ada dapat terlestarikan.<b><o:p></o:p></b></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-14.85pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">2.Perspektif proses; </span></b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">peningkatan\r\nkualitas pemangku agama dan adat dalam rangka me</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">-</span><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">ngembalikan fungsi “<i>tigo tungku sajarangan, tali tigo sapilin</i>”\r\ndan </span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">peningkatan kuantitas\r\ndan kualitas sarana dan prasarana </span><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif\">seni budaya masyarakat\r\nanak nagari</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-14.85pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">3.Perspektif kelembagaan; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">peningkatan dan pengembangan lembaga agama</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">\r\ndan</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\"> adat yang berkualitas serta\r\npengembangan dan pemberdayaan kelompok</span><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif\"> seni budaya masyarakat\r\nanak nagari</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.5pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">4.Perspektif pengelolaan keuangan; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">peningkatan efektivitas dan efisiensi belanja\r\npembangunan </span><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Times New Roman&quot;,serif\">nagari</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">\r\nterhadap </span><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Times New Roman&quot;,serif\">revitalisasi adat dan seni budaya anak nagari</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US;mso-fareast-language:\r\nIN\">.</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:18.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-18.0pt;\r\nline-height:115%\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:63.8pt;margin-bottom:.0001pt;text-align:justify;text-indent:-63.8pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">Misi </span></b><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">5\r\n</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">: </span></b><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Peningkatan\r\nderajat kualitas kesehatan masyarakat serta penataan lingkungan yang bersih dan\r\nsehat.</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:13.5pt;margin-bottom:.0001pt;text-align:justify;line-height:115%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">Kebijakan umum yang </span><span style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">di</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">tempuh dalam mewujudkan misi 2 adalah :<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.4pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.7pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">1. Perspektif masyarakat; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">peningkatan kualitas </span><span style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">ketersediaan,\r\nketerjangkauan dan kesetaraan pendidikan dan akses pembiayaan bagi penduduk\r\nmiskin</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">, p</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">eningkatan\r\nkuantitas dan kualitas kurikulum muatan lokal yang berbasis iman dan taqwa</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">, p</span><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">eningkatan kuantitas dan kualitas\r\nsarana dan prasarana perpustakaan</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">,\r\npeningkatan</span><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Times New Roman&quot;,serif\"> perluasan dan pemerataan </span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">pelayanan</span><span lang=\"EN-US\" style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\"> </span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">kesehatan<span style=\"color:red\">,&nbsp;&nbsp; </span>p</span><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif\">eningkatan </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:Tahoma\">layanan kesehatan ibu dan anak</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> dan p</span><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">eningkatan pelayanan KB</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> serta p</span><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif\">eningkatan aksesibilitas\r\npemuda dalam berorganisasi</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">\r\nserta berolahraga. </span><span style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:115%\"><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.5pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">2.Perspektif proses; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">optimalisasi dukungan pemerintah, pemerintah provinsi\r\ndan pemerintah kabupaten dalam penyediaan bantuan operasional satuan\r\npendidikan, penyediaan bantuan pendidikan bagi anak dari keluarga miskin, p</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">emerataan\r\ndalam penyebaran tenaga kader kesehatan</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">, peningkatan kualitas dan kualitas sarana </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">satuan\r\npos pelayanan kesehatan</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">,\r\npeningkatan kualitas nilai-nilai religius dilingkungan sekolah, peningkatan\r\nkerjasama dengan pihak swasta dalam penyelengaraan pendidikan dan p</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">eningkatan\r\nkuantitas dan kualitas sarana dan prasarana perpustakaan</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">. Selain itu peningkatan promosi kesehatan kondisi\r\nlingkungan sehat dan prilaku hidup sehat yang melibatkan tenaga dan kader\r\nkesehatan dan revitalisasi posyandu dalam peningkatan kesehatan ibu dan anak\r\nserta pemantauan status gizi balita dan optimalisasi kader </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">P</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">osyandu&nbsp; dalam </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">komunikasi,\r\ninformasi dan edukasi</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">\r\nprogram keluarga berencana.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.5pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">3.Perspektif kelembagaan; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">p</span><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">emerataan dalam penyebaran tenaga\r\nkader kesehatan</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">, p</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">eningkatan\r\nkualitas dasawisma melalui perluasan ke-sempatan studi lanjutan</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">, peningkatan kualitas manajemen </span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">PAUD</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> sesuai dengan standar mutu nasional, p</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">eningkatan\r\npembinaan terhadap pendidikan non formal</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> dan peningkatan kuantitas dan kualitas lembaga\r\nperpustakaan berbasis masyarakat. Selain itu, p</span><span style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">eningkatan\r\nkualitas manajemen pelayanan kesehatan dasar dan rujukan</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> sesuai dengan standar pelayanan prima, p</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">eningkatan\r\npemerataan distribusi tenaga kesehatan dan non kesehatan</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> <span lang=\"EN-US\">dan </span></span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:Tahoma;mso-ansi-language:EN-US\">peningkatan</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">\r\npeserta KB aktif dengan mengoptimalkan Posyandu</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> serta peningkatan pembinaan organisasi pemuda dan\r\nolahraga.&nbsp; <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.5pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">4.Perspektif pengelolaan keuangan; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">peningkatan kualitas penerapan anggaran berbasis\r\nkinerja dalam penyusunan rencana kerja </span><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif\">satuan kerja perangkat\r\nnagari</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\"> pelaksana bidang\r\npendidikan, kesehatan, pemuda dan olahraga serta perpustakaan dan peningkatan\r\nefektivitas dan efisiensi belanja pembangunan </span><span style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">nagari</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\"> terhadap </span><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif\">satuan kerja perangkat\r\nnagari</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\"> penyelengggara.\r\nSelain itu, peningkatan pengelolaan retribusi dari bidang kesehatan secara\r\ntrasparan dan akuntabel, sehingga dapat meningkatkan PA</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">N</span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">.</span><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:27.0pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.5pt;\r\nline-height:115%\"><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Times New Roman&quot;,serif\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:1.0cm;margin-bottom:.0001pt;text-align:justify;text-indent:-14.65pt;\r\nline-height:115%\"><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Times New Roman&quot;,serif\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:63.8pt;margin-bottom:.0001pt;text-align:justify;text-indent:-63.8pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">Misi </span></b><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">6</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">\r\n:</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\"> </span></b><b><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif\">Peningkatan\r\nperan masyarakat dan generasi muda serta perantau untuk kemajuan pembangunan\r\nnagari.</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:13.5pt;margin-bottom:.0001pt;text-align:justify;text-indent:-13.5pt;\r\nline-height:115%\"><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp; </span><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">Kebijakan umum yang tempuh dalam mewujudkan misi 5\r\nadalah :<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:1.0cm;margin-bottom:.0001pt;text-align:justify;text-indent:-14.65pt;\r\nline-height:115%\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">1. Perspektif masyarakat; </span></b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">p</span><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif\">eningkatan dan pengelolaan potensi\r\nsumber daya generasi muda</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,serif;mso-farea