INSERT INTO `halaman` (`halaman_id`, `halaman_judul`, `halaman_slug`, `halaman_konten`) VALUES
(10, 'Data Kependudukan', 'data-kependudukan', '<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal;tab-stops:21.3pt\"><span lang=\"EN-US\" style=\"font-size:\r\n12.0pt;font-family:&quot;Times New Roman&quot;,serif\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Pemerintahan Nagari telah berupaya\r\nmendata serta menginventarisir keadaan penduduk baik secara mingguan maupun\r\nbulanan dan data tersebut selalu dilaporkan kepada Camat Sumpur Kudus, setiap\r\nakhir bulan seperti data penduduk yang pindah, lahir, meninggal, data tersebut\r\ndiinventarisir oleh Kepala Jorong di wilayah masing-masing.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l0 level1 lfo1;tab-stops:21.3pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">Pendidikan\r\ndan Olah Raga<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;line-height:normal;tab-stops:\r\n21.3pt\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nagari Tanjung Bonai Aur Selatan\r\nmempunyai potensi sumber daya manusia cukup baik dan kalau dilihat dari segi\r\npendidikan masyarakat telah banyak yang melanjutkan pendidikan anaknya ke\r\nperguruan tinggi.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;line-height:normal;tab-stops:\r\n21.3pt\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dibidang pendidikan keagamaan masih\r\nsangat kurangnya kesejahteraan dari guru-guru, baik guru TPQ/TPSQ maupun\r\nguru-guru kelompok yasinan, sarafal anam dan lainnya. Dan untuk pendidikan\r\nformal masyarakat baru menyadari akan pentingnya arti pendidikan untuk\r\nanak-anaknya dan jumlahnya yang telah menamatkan perguruan tinggi lebih kurang\r\n70 orang</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:IN\"> dan </span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif\">3</span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:IN\"> orang telah\r\nmenamatkan S2</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;line-height:normal;tab-stops:\r\n21.3pt\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dibidang Olah raga mayarakat cukup\r\nmenyokong akan kegiatan olah raga yang banyak diminati oleh pemuda seperti Bola\r\nKaki, Volli, dll. Namun demikian masih ada jorong yang belum memiliki sarana\r\nolah raga seperti Lapangan Bola Kaki.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;line-height:normal;tab-stops:\r\n21.3pt\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:\r\nnormal;mso-list:l0 level1 lfo1;tab-stops:21.3pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">Umur\r\ndan Kesejahteraan<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;line-height:normal;tab-stops:\r\n21.3pt\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kalau dilihat dari Jumlah penduduk berdasarkan\r\ndata bulan Januari</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-ansi-language:IN\"> </span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">2021 telah\r\nmencapai 2.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:IN\">2</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif\">31 jiwa yang terdiri dari laki-laki 1.158\r\njiwa dan Perempuan 1.073 jiwa terdiri dari beragam umur </span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:\r\nIN\">, dengan KK 6</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif\">26</span><span style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-ansi-language:IN\"> terdiri dari KK Laki-laki 5</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">60</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:\r\nIN\"> dan KK Perempuan </span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif\">74</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:\r\nIN\"> </span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">dan\r\njuga kalau dilihat dari tingkat kesejahteraan penduduk adalah tidaklah terlalu\r\nmiskin walaupun ada sekitar ±286 KK yang pendapatan perkapitanya sangat rendah.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;line-height:normal;tab-stops:\r\n21.3pt\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:\r\nnormal;mso-list:l0 level1 lfo1;tab-stops:21.3pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">Agama<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bo