<span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:\r\nIN\">dari</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">\r\n</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:IN\">92</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif\"> KK</span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:IN\"> tersebut</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\"> yang\r\nperekonomiannya dibawah standar penghidupan yang layak.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;line-height:normal;tab-stops:\r\n21.3pt\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:\r\nnormal;mso-list:l0 level1 lfo1;tab-stops:21.3pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">Sosial\r\ndan Budaya<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;line-height:normal;tab-stops:\r\n21.3pt\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Keadaan sosial masyarakat nagari\r\nTanjung Bonai Aur Selatan tidak terlepas dari system adat salingka nagari yang\r\nsampai saat ini masih kental keberadaannya. Hubungan individual antara\r\nmasyarakat luas masih kuat dengan sifat kegotong royongan yang masih tinggi.\r\nSifat kegotong royongan ini dapat dilihat setiap saat terutama apabila terdapat\r\nhal-hal yang harus diselesaikan dengan cara musyawarah dan mufakat mencari\r\nkeputusan bersama demi suatu kemajuan dan dalam kegiatan yang sifatnya harus\r\nbergotong royong masih terlaksana sampai saat ini baik itu diwaktu akan turun\r\nkesawah maupun gotong royong untuk memperbaiki jalan</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:\r\nIN\"> dan jembatan</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif\"> yang ada dalam nagar</span><span style=\"font-size:\r\n12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:IN\">i maupun dalam\r\nacara perhelatan dan kemalangan.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;line-height:normal;tab-stops:\r\n21.3pt\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:IN\">&nbsp;</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:\r\nnormal;mso-list:l0 level1 lfo1;tab-stops:21.3pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times Ne