r\nbaik disebabkan masalah pendanaan. <o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:21.3pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;line-height:normal;tab-stops:21.3pt\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:\r\nnormal;mso-list:l0 level1 lfo1;tab-stops:21.3pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">Sarana\r\ndan Prasarana Nagari<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:21.3pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;line-height:normal;tab-stops:21.3pt\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp; Untuk sarana dan prasarana, nagari Tanjung\r\nBonai Aur Selatan juga memiliki potensi yang cukup tersedia untuk menunjang\r\nkegiatan dan aktifitas masyarakat nagari, baik untuk sektor pendidikan,\r\nkesehatan dan perekonomian masyarakat. Selain itu Nagari Tanjung Bonai Aur\r\nSelatan juga memiliki sarana dan Prasarana seperti adanya jalan-jalan kabupaten\r\ndan jalan-jalan nagari sebagai penghubung dan termasuk urat nadi perekonomian\r\nmayarakat, baik untuk menuju akses pasar maupun menuju sekolah guna menunjang\r\nkegiatan pendidikan namun masih banyak jalan-jalan Nagari yang belum layak\r\nsebagaimana mestinya. Demikian pula dengan sarana kesehatan Nagari Tanjung\r\nBonai Aur Selatan mempunyai dua buah Polindes dan dua orang bidan nagari serta\r\nposyandu dengan seluruh kader-kader yang ada guna meningkatkan derajat\r\nkesehatan masyarakat</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:IN\"> dan alhamdullillah pada tahun&nbsp; ini</span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif\"> </span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:IN\">kita telah membangun\r\njalan keposkesri puntian dengan dana desa yang kita terima</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:21.3pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-align:justify;line-height:normal;tab-stops:21.3pt\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dala</span><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:IN;mso-fareast-language:\r\nEN-US;mso