(13, 'BPN', 'bpn', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; text-align: center; color: rgb(50, 50, 51); font-family: Helvetica, Arial;\"><span style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\"><span style=\"font-weight: bolder;\">BADAN PERMUSYAWARATAN NAGARI</span></span></p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(50, 50, 51); font-family: Helvetica, Arial;\"><span style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">Badan Permusyawaratan Nagari/ Desa (BPN/BPD) dalam sistem pemerintahan desa sekarang ini menempati posisi yang sangat penting. Tapi sebenarnya, apa saja tugas para anggota BPN yang terhormat itu sehingga menjadi begitu penting bagi warga desa? Inilah penjabaran dari Peraturan Menteri Dalam Negeri Republik Indonesia No 110 Tahun 2016 tetang Badan Permusyawaratan Desa.</span></p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(50, 50, 51); font-family: Helvetica, Arial;\"></p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(50, 50, 51); font-family: Helvetica, Arial;\"></p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(50, 50, 51); font-family: Helvetica, Arial;\"><span style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">Fungsi BPN &nbsp;membahas dan menyepakati Rancangan Peraturan Desa bersama Wali Nagari, menampung dan menyalurkan aspirasi masyarakat Nagari dan melakukan pengawasan kinerja Wali Nagari. Dari tiga tugas ini sudah jelas BPN merupakan lembaga yang memiliki kekuatan dalam dalam menyepakati peraturan Nagari yang bakal menjadi pedoman pelaksanaan pembangunan Nagari.</span></p><p>Struktur kepengurusannya adalah sebagai berikut:</p><table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"0\" style=\"width: 418.95pt; margin-left: 4.65pt;\"><tbody><tr style=\"height: 15pt;\"><td width=\"42\" nowrap=\"\" style=\"width: 31.55pt; bor